// import { StatusBar } from 'expo-status-bar'
import React from 'react';
import { StatusBar, View } from 'react-native'
import 'react-native-gesture-handler'
import { NavigationContainer } from '@react-navigation/native'
import { createStackNavigator } from '@react-navigation/stack'

import { AppContextType } from './app/types/types'
import StartPage from './app/pages/Start'
import SettingsPage from './app/pages/Settings'
import IntroductionPage from './app/pages/Introduction'
import RolesPage from './app/pages/Roles'
import ItemsPage from './app/pages/Items'
import NightTimePage from './app/pages/NightTime'
import PlayersPage from './app/pages/Players'
import MorningTimePage from './app/pages/MorningTime'
import DayTimePage from './app/pages/DayTime'

export type RootStackParamList = {
  StartPage: undefined
  SettingsPage: undefined
  IntroductionPage: undefined
  RolesPage: {Mode:string, PlayerCount:number}
  PlayersPage: {PlayerCount:number}
  ItemsPage: {Mode:string}
  NightTimePage: undefined
  MorningTimePage: undefined
  DayTimePage: undefined
};

const RootStack = createStackNavigator<RootStackParamList>();
export const AppContext = React.createContext({} as AppContextType);

export default function App() {
  return (
    <View style={{ flex: 1,  marginTop: StatusBar.currentHeight }}>
      <AppContext.Provider value={{mode: 'normal', playerCount: 4, roleCounts: [], playersInfo: [], dayNumber: 0}}>
        <NavigationContainer>
          <RootStack.Navigator>
            <RootStack.Screen
              name="MorningTimePage"
              component={MorningTimePage}
              options={{ headerShown: false }}
            />
            <RootStack.Screen
              name="StartPage"
              component={StartPage}
              options={{ headerShown: false }}
            />
            <RootStack.Screen
              name="SettingsPage"
              component={SettingsPage}
              options={{ headerShown: false }}
            />
            <RootStack.Screen
              name="IntroductionPage"
              component={IntroductionPage}
              options={{ headerShown: false }}
            />
            <RootStack.Screen
              name="RolesPage"
              component={RolesPage}
              options={{ headerShown: false }}
            />
            <RootStack.Screen
              name="PlayersPage"
              component={PlayersPage}
              options={{ headerShown: false }}
            />
            <RootStack.Screen
              name="ItemsPage"
              component={ItemsPage}
              options={{ headerShown: false }}
            />
            <RootStack.Screen
              name="NightTimePage"
              component={NightTimePage}
              options={{ headerShown: false }}
            />
            <RootStack.Screen
              name="DayTimePage"
              component={DayTimePage}
              options={{ headerShown: false }}
            />
          </RootStack.Navigator>
        </NavigationContainer>
      </AppContext.Provider>
    </View>
  );
}
